    visible: true
  };

  render() {
    return (
      <div className="App" style={{backgroundColor: "#C99CE9"}}>
      <h3> Saarang DevOps App: <a>Sayash Raaj CE19B113 </a></h3>
      	<BrowserRouter>
		<Route path="/" component={Form} exact/>
       	<Route path="/FetchRandomUser" component={FetchRandomUser}/>
       	</BrowserRouter>
      </div>
    );
  }
}

export default App;
